import React, { Component } from "react";
import {BrowserRouter as Router, Route, Link} from 'react-router-dom';
import "./style.css";

class App extends Component {
  constructor(props) {
    super(props)
    const token = localStorage.getItem('user-jwt');
    this.state = {
       isLoggedIn: false || token,
       zipcode:"",
    }
  }

  render() {
    return (
      <Router>
        <div className='app'>
          <header>
            <h1 className="hearder-title">Give Back NYC</h1>
            <h2 className="hearder-subtitle">to your community</h2>
          </header>
          {this.isLoggedIn && (
            <nav>
              <form className="search-form" onSubmit={this.zipcodeSearch}>
                <label>Search volunteering opportunities by zipcode: 
                  <input className="search-zipcode" type="text" placeholder="Enter Zipcode" value={this.state.zipcode} onChange={this.handleChange}/>
                </label>
                <button className="go-button" onClick={this.zipcodeSearch}>Go!</button>
                <label>Search volunteering opportunities by zipcode: 
                  <button className="go-button" onClick={this.nearYouSearch}>Go!</button>
                </label>
              </form>
              <Link className="" to='/' onClick={this.logOut}>Log Out</Link>
            </nav>
          )}
          <div class="body"> 
            {/* <Route exact path='/' component={Login} />
            <Route exact path='/register' component={Register} /> */}
          </div> 
        </div>
      </Router>
    )
  }
}

export default App;
